import React from "react";
import NewComponent from "./components/NewComponent";

/**
 * <> </> : use fragment to enclose all your tags in case multiple
 * tags needs to be returned
 */
function App() {
  return (
    <>
      <div id="something" className="App">
        <h1>Hello world</h1>
      </div>
      <div className="new-component">
        <NewComponent />
      </div>
    </>
  );
}

export default App;
